import React from 'react';
import './App.css';
import {Button} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div>
      <h1>Hello world</h1>
      <Button variant="primary">Button</Button>
    </div>
  );
}

export default App;
